import React, { useEffect, useState } from "react";
import footballIcon from "../american-football-player.png";
import friends from "../friends.png";
import more from "../more.png";
import Menu from "./Menu";
const Nav = (props) => {
  return (
    <div>
      <ul class="bg-[#DA1E55] py-[8px] flex justify-around fixed w-screen top-0 z-30 items-center">
        <button
          onClick={() => {
            props.setOpen(!props.isOpen);
            props.setY(window.scrollY);
            window.scrollTo(0, parseInt(props.yPos || "0") * -1);
          }}
        >
          <img
            className="w-[2em] h-[2em]"
            src={more}
            alt="description of image"
          />
        </button>

        <img
          className="w-[5em] h-[5em] md:mx-[10em]"
          src={footballIcon}
          alt="description of image"
        />
        <img
          className="w-[2em] h-[2em]"
          src={friends}
          alt="description of image"
        />
      </ul>
    </div>
  );
};

export default Nav;
